import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import logo from './logo.png';
import './App.css';
import {
    Navbar,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    Button

} from 'reactstrap';

class App extends Component {
  render() {
      return (
            <div>
            <Navbar className = "dark" light expand = "md" >
            <NavbarBrand href = "/" ><img src={logo} alt="logo" /></NavbarBrand> 

            <Nav className = "ml-auto"
            navbar >
            <NavItem >
            <NavLink href = "/components/" > Last releases </NavLink> </NavItem> <NavItem >
            <NavLink href = "https://github.com/reactstrap/reactstrap" > My Movies </NavLink> 
            </NavItem>
            <Button color = "secondary" >11 films </Button>
             </Nav> </Navbar> 
            </div>
        );
    }
}

export default App;
